import ContextProvider from './Context';
import InfoPanel from './components/InfoPanel';
import Main from './components/Main';

const App = () => {
  return (
    <ContextProvider>
      <div className="App">
        <Main />
        <InfoPanel />
        <HelpButton />
      </div>
    </ContextProvider>
  );
}

export default App;
